import React from "react";
import LoginContainer from "../components/containers/LoginContainer";

class AuthentificationLayout extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      container: null,
    };
  }

  componentDidMount() {
    this.setContainer(<LoginContainer setContainer={this.setContainer} />);
  }

  setContainer(container) {
    this.setState({
      container: container,
    });
  }

  render() {
    return <div className="auth-container"> {this.state.container}</div>;
  }
}

export default AuthentificationLayout;
